import React from "react";
import Carousel from "react-bootstrap/Carousel";


const CarouselItemBrand = (props) => {
    return (
        <Carousel>
            <Carousel.Item>
                <img
                    className="d-block w-100"
                    src={`images/$(props.srcImg)`}
                    alt={$(props.srcImg)}
                />
                <Carousel.Caption>
                    <h3>First slide label</h3>
                    <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                </Carousel.Caption>
            </Carousel.Item>

        </Carousel>
    );
};


export default CarouselItemBrand;
